import React from 'react';

function Home() {
    return (
        <div>
            {/* Header */}
            <header style={headerStyle}>
                <h1>Header</h1>
            </header>

            {/* Left Menu Bar */}
            <div style={leftMenuBarStyle}>
                <h2>Left Menu Bar</h2>
                <ul style={menuListStyle}>
                    <li><a href="#addProduct">Add Product</a></li>
                    <li><a href="#removeProduct">Remove Product</a></li>
                </ul>
            </div>

            {/* Main Content */}
            <main style={mainContentStyle}>
                <h1>Home Page</h1>

                {/* Dashboard */}
                <div style={dashboardStyle}>
                    <div style={cardStyle}>Card 1</div>
                    <div style={cardStyle}>Card 2</div>
                    <div style={cardStyle}>Card 3</div>
                    <div style={cardStyle}>Card 4</div>
                </div>
            </main>

            {/* Footer */}
            <footer style={footerStyle}>
                <h3>Footer</h3>
            </footer>
        </div>
    );
}

// Styles
const headerStyle = {
    backgroundColor: '#333',
    color: '#fff',
    textAlign: 'center',
    padding: '1rem',
};

const leftMenuBarStyle = {
    backgroundColor: '#f4f4f4',
    width: '20%',
    float: 'left',
    padding: '1rem',
};

const menuListStyle = {
    listStyleType: 'none',
    padding: 0,
};

const mainContentStyle = {
    marginLeft: '20%',
    padding: '1rem',
};

const dashboardStyle = {
    display: 'grid',
    gridTemplateColumns: 'repeat(2, 1fr)',
    gap: '1rem',
};

const cardStyle = {
    backgroundColor: '#f4f4f4',
    padding: '1rem',
    border: '1px solid #ccc',
};

const footerStyle = {
    backgroundColor: '#333',
    color: '#fff',
    textAlign: 'center',
    padding: '1rem',
    clear: 'both',
};

export default Home;
